import {html, PolymerElement} from '@polymer/polymer/polymer-element.js';
import '@polymer/paper-input/paper-input.js';
import '@polymer/polymer/lib/elements/dom-repeat.js'
import '@polymer/paper-button/paper-button.js';
import '@polymer/paper-card/paper-card.js';

/**
 * `search-component`
 * 
 *
 * @customElement
 * @polymer
 * @demo demo/index.html
 */
class SearchComponent extends PolymerElement {
  
  static get template() {
    return html`
      <style>
        :host {
          display: block;
        }
        .card {
          width: 400px;
          height: auto;
          margin: 10px;
          }
      </style>
      <h2> [[size]] villanos Eliminados</h2>
      <paper-input label="buscar" value="{{searchName}}"  on-keyup="searchPokemon"></paper-input>
      <template is="dom-repeat" items="{{employees}}">
        <paper-card image="{{item.image}}" class$="{{item.status}}">
          <div class="card-content">
            <p>{{item.first}}</p>
            <p>{{item.last}}</p>
            <p>{{item.age}}</p>
          </div>
        </paper-card>
    </template>
    `;
  }
  static get properties() {
    return {
      searchName: {
        type: String,
        value: ''
      },
      size:{
        type: Number,
        computed: "_getUsersListSize(users)"
      },
      employees: {
        type: Array,
        value() {
          return [
            {first: 'Bob', last: 'Li',status:'on',age: 28,image:"https://imagenes.milenio.com/TKcRTFes8lny9I9wn43L_rNc964=/958x596/https://www.milenio.com/uploads/media/2019/11/20/christian-bale-revela-rechazo-filmar_229_0_598_372.jpg"},
            {first: 'Ayesha', last: 'Johnson',status:'off',age: 28,image:"data:image/jpeg;base64,"},
            {first: 'Fatma', last: 'Kumari',status:'on',age: 28,image:"data:image/jpeg;base64,"},
            {first: 'Tony', last: 'Mori',status:'off',age: 28,image:"data:image/jpeg;base64,"}
            // {status: 'on',firstName:'Bruce', lastName:'Wayne', age: '28', herramienta:'batimovil'},
            /* {image:'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRgviRmbM3puRxqXko43RfmP2BW5EIGkNLmy4wVEbYovylVnc90&s',status: 'on',firstName:'joker', lastName:'g', age: '33', herramienta:'palo'},
            {image:'https://upload.wikimedia.org/wikipedia/en/3/35/Supermanflying.png',status: 'off',firstName:'clark', lastName:'kent', age: '30', herramienta:'superPoderes'},
            {image:'data:image/jpeg;base64,',status: 'on',firstName:'ricardo', lastName:'tapia', age: '18', herramienta:'agilidad'},
            {image:'data:image/jpeg;base64,',status: 'off',firstName:'selina', lastName:'kyle', age:'28', herramienta:'lazo'} */
          ]
        }
      }
    };
  }
  searchPokemon(event){
    this.dispatchEvent(new CustomEvent("list-search",{
      bubbles:false,
      composed:false,
      detail:this.searchName
    }))
  }

  _getUsersListSize(users) {
    return users.filter(user => user.status === 'on').lenght
  }

  
}

window.customElements.define('search-component', SearchComponent);
